  input: '"TEXT","F3XA","C00396416","In response to your letter dated October 15,
    2004 regarding our May Monthly Report (4/1/04 - 4/30/04) we are filing this amended
    report. All payments made for this period for salaries and wages by our committee
    were reported on Line 21(b) of the Detailed Summary Page. All of these payments
    should have been reported on Line 30(b) Federal Election Activity Paid Entirely
    With Federal Funds of the Detailed Summary Page. Thank you for bringing this to
    our attention. We apologize for any inconvenience this may have caused you. The
    payment described as Mailing List paid to SCM Associates was for mailing a fundraising
    letter for our party committee, and not for any federal candidate. All expenditures
    for fundraising were made on behalf of our party committee and have been properly
    reported. If you have additional questions or need more information, please let
    us know. Thank you for your help and assistance in this matter."'
